#include <stdio.h>
#include <stdlib.h> // Fr malloc, free, realloc
#include <string.h> // Fr strlen, strcpy, atoi

// Annahme: tStud und displayStudent sind wie in den vorherigen Beispielen definiert.
// Fr dieses Beispiel fgen wir das 'next'-Feld hinzu.
typedef struct sStud { // sStud statt tStud, da die Struktur sich selbst referenziert
    char name[30 + 1];
    int matrNr;
    float noteKl;
    int noteBel;
    struct sStud* next; // Zeiger auf das nchste Element in der Liste
} tStud; // Behalten den typedef Namen tStud bei

char buf[128]; // Globaler Puffer

void displayStudent(tStud* s) {
    printf("%-30s, %6d, %3.1f, %d\n",
           s->name,
           s->matrNr,
           s->noteKl,
           s->noteBel);
}

// Angepasste getStudent Funktion fr die verkettete Liste (hnlich Beispiel 2)
// Diese Funktion gibt einen Pointer auf eine *neu* auf dem Heap allokierte tStud-Struktur zurck.
tStud* getStudent() {
    tStud* ps = malloc(sizeof(tStud)); // Speicher fr eine neue tStud-Struktur allokieren

    if (ps) {
        printf("%-10s: ", "Name");
        fgets(buf, 32, stdin);
        buf[strlen(buf) - 1] = 0;
        strcpy(ps->name, buf);

        printf("%-10s: ", "MatrikelNr");
        fgets(buf, 32, stdin);
        ps->matrNr = atoi(buf);

        ps->noteKl = 0;
        ps->noteBel = 0;
        ps->next = NULL; // Wichtig: Der 'next'-Pointer des neuen Knotens ist vorerst NULL
    }
    return ps;
}


int main(int argc, char** argv) {
    char proceed = 'j';      // Steuerzeichen fr die Schleife: 'j' fr "ja, weiter"
    tStud *pdata = NULL;     // 'pdata' ist der Head-Pointer der verketteten Liste.
                             // Er zeigt immer auf den *ersten* Datensatz.
                             // Initial auf NULL, da die Liste anfangs leer ist.
    tStud *ptmp;             // Temporrer Pointer, wird fr neue Datenstze und zur Iteration verwendet.
    int count = 0;           // Nicht direkt fr die verkettete Liste bentigt, aber im Beispiel vorhanden.
    int i;                   // Iterationsvariable (nicht im Loop-Body verwendet, aber in 'for' schleife)

    do {
        ptmp = getStudent(); // Ruft getStudent auf, das einen Pointer auf eine neu allokierte tStud-Struktur zurckgibt.

        if (ptmp) {
            // Logik zum Hinzufgen des neuen Studenten zur Liste (am Anfang der Liste)
            ptmp->next = pdata; // Der 'next'-Pointer des *neuen* Knotens zeigt auf das,
                                // worauf 'pdata' (der aktuelle erste Knoten) zuvor zeigte.
                                // Dies verbindet den neuen Knoten mit dem Rest der Liste.
            pdata = ptmp;       // 'pdata' (der Head-Pointer) wird aktualisiert, um nun auf den *neuen* Knoten zu zeigen.
                                // Der neue Knoten ist somit der erste Knoten der Liste.

            // count++; // Wenn 'count' verwendet wrde, msste es hier inkrementiert werden.
                       // Im Beispiel ist es auskommentiert/nicht verwendet fr die Logik.
        } else {
            // Fehlerbehandlung, falls Speicher fr einen neuen Studenten nicht zugewiesen werden konnte.
            perror(NULL); // Gibt eine Systemfehlermeldung aus.
            break;        // Bricht die Schleife ab, da keine weiteren Daten verarbeitet werden knnen.
        }

        printf("Weitere Eingabe von Daten (j/n): "); // Fragt, ob weitere Daten eingegeben werden sollen.
        fgets(buf, 128, stdin);                     // Liest die Benutzereingabe in den globalen Puffer.
        proceed = buf[0];                           // Das erste Zeichen der Eingabe bestimmt, ob es weitergeht.

    } while (proceed == 'j'); // Die Schleife wird fortgesetzt, solange 'j' eingegeben wird.

    // ---------- Daten anzeigen ----------
    // Die Schleife iteriert durch die verkettete Liste und zeigt jeden Studenten an.
    // Start: ptmp zeigt auf den Anfang der Liste (pdata).
    // Bedingung: Solange ptmp nicht NULL ist (solange es Knoten gibt).
    // Iteration: ptmp springt zum nchsten Knoten (ptmp->next).
    for (ptmp = pdata; ptmp; ptmp = ptmp->next) {
        displayStudent(ptmp); // Ruft displayStudent fr den aktuellen Knoten auf.
    }

    // ---------- Speicher freigeben ----------
    // Diese Schleife durchluft die Liste und gibt den Speicher fr jeden Knoten frei.
    // Dies muss nach der Anzeige und vor dem Programmende geschehen.
    while (pdata) { // Solange 'pdata' nicht NULL ist (solange es noch Knoten in der Liste gibt).
        ptmp = pdata->next; // Speichert den Pointer zum *nchsten* Knoten, BEVOR der aktuelle Knoten freigegeben wird.
        free(pdata);        // Gibt den Speicher des aktuellen Knotens frei.
        pdata = ptmp;       // 'pdata' wird auf den nchsten Knoten gesetzt, um die Iteration fortzusetzen.
    }

    return 0; // Programm erfolgreich beendet.
}
